import React from "react";
import importFishStyle from "../../styles/ImportFish.module.scss";
const ImportFish = () => {
  return (
    <div className={importFishStyle.importFish}>
      <h2 id="hometitle" className={importFishStyle.homeTitle}>
        Cá Biển Nhập Khẩu
      </h2>
      <div id="feature">
            
      </div>
    </div>
  );
};

export default ImportFish;
